import React, { Component } from 'react';
import axios from 'axios';
import '../App.css'

export default class content4 extends Component {
    state ={
        x:0,
        doctor: [],
    };

    componentDidMount() {
        axios.get('http://localhost:5000/doctorList')
            .then(res => {
                this.setState({doctor: res.data});
            }) 
            .catch((error) => {
                console.log(error);
            })
                
          
        }   

    render() {
        return (
            <div>
                <div className="content3">
                    <table>
                    <caption><span><b>Doctor List</b></span></caption>

                        <tr>
                            <th>Sr. No.</th>
                            <th>Doctor Name</th>
                            <th>Speciality</th>
                            <th>Timing</th>
                            <th>Schedule</th>
                        </tr>
                        { 
                            this.state.doctor.map(doctor => 
                            
                            <tr>
                                <td> {this.state.x= (this.state.x+1)}.</td>
                                <td>{doctor.name}</td>
                                <td>{doctor.speciality}</td>
                                <td>{doctor.timing}</td>
                            </tr>
                    
                            )}
                   
                    </table>
                </div>
            </div>
        )
    }
}
